import { makeAutoObservable } from "mobx";

export default class AlertStore {
    constructor() {
        this._visible = true
        this._type = ""
        this._text = ""
        makeAutoObservable(this)
    }
    setType(types) {
        this._type = type
    }
    setText(text) {
        this._text = text
    }
    setVisible(value) {
        this._visible = value
    }
    get type() {
        return this._type
    }
    get text() {
        return this._text
    }
    get visible() {
        return this._visible
    }
}
